import { date } from "./date";
import { getUser } from "./user";
const _date = date();

const inputform = async (title, content, page, boardid) => {
  const _date = date();
  const _user = getUser();
  console.log(_user);
  return {
    page: page,
    board_id: boardid,
    id: -1,
    title: title,
    content: content,
    writer: await _user.user.email,
    likes: 0,
    date: _date,
    comments: [],
  };
};

export default inputform;
